import React from 'react';
import { Col, ListGroup } from 'react-bootstrap';

const ListKategori = ({keranjangs}) => {
	return(
		<Col md={3} mt="2">
			<h4><strong>Hasil</strong></h4>
			<hr />
			{keranjangs.length !== 0 && (
				<ListGroup variant="flush">
					{ keranjangs.map((menuKeranjang) => (
						<ListGroup.Item>
							Cras justo odio
						</ListGroup.Item>
					))}
				</ListGroup>
			)}
		</Col>
	)
}

export default ListKategori;
